import axios from 'axios';
import { useEffect } from 'react';
const API_KEY = '43f7b7cce2ae5cabfc5e2f76a4248ec7';
import HeaderItem from './HeaderItem';
//import './GalleryHeader.css';
const GalleryHeader = (props, state) => {
    var request = "";

    useEffect(() => {
        if (props.genreList.length == 0) {
            request = "https://api.themoviedb.org/3/genre/movie/list?api_key=" + API_KEY + "&language=en-US";
            axios.get(request)
            .then ((response) => {
                console.log(response);
                props.setGenreList(genreList => [...genreList, response.data.genres]);
            })
            .catch(function(error) {
                console.log(error);
            })
        }
    }, [props, state]);

    console.log(props.genreList);
    const content = props.genreList.map(genre => <HeaderItem key = {genre.id} genre = {genre}/>);


    return (
        //<h1>hello</h1>
         <main>
             {content}
       </main>
    );
} 
export default GalleryHeader
